/* eslint-disable default-param-last */
export default function SleepyReducer(state = null, action) {
  switch (action.type) {
    case 'AUTH_USER':
      console.log(action.payload);
      return action.payload;
    case 'AUTH_ERROR':
      return { errorMessage: action.payload };
    default:
      return state;
  }
}
